DROP TABLE IF EXISTS bat_style;

CREATE TABLE `bat_style` (
  `bat_style_id` int(10) NOT NULL AUTO_INCREMENT,
  `bat_style_title` varchar(50) NOT NULL,
  PRIMARY KEY (`bat_style_id`)
) ENGINE=InnoDB AUTO_INCREMENT=14 DEFAULT CHARSET=latin1;



DROP TABLE IF EXISTS bowl_style;

CREATE TABLE `bowl_style` (
  `bowl_style_id` int(10) NOT NULL AUTO_INCREMENT,
  `bowl_style_title` varchar(50) NOT NULL,
  PRIMARY KEY (`bowl_style_id`)
) ENGINE=InnoDB AUTO_INCREMENT=29 DEFAULT CHARSET=latin1;



DROP TABLE IF EXISTS category;

CREATE TABLE `category` (
  `category_id` int(11) NOT NULL AUTO_INCREMENT,
  `category_title` varchar(150) NOT NULL,
  PRIMARY KEY (`category_id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=latin1;



DROP TABLE IF EXISTS cmatch;

CREATE TABLE `cmatch` (
  `match_id` int(10) NOT NULL AUTO_INCREMENT,
  `match_type_id` int(10) NOT NULL,
  `tournament_id` int(10) NOT NULL,
  `match_name` varchar(255) NOT NULL,
  `location` varchar(255) NOT NULL,
  `no_inngs` int(10) NOT NULL,
  `starttime` datetime NOT NULL,
  `description` longtext NOT NULL,
  `match_status` int(2) NOT NULL DEFAULT '0',
  `toss` varchar(100) NOT NULL DEFAULT '',
  `umpire1` int(11) NOT NULL,
  `umpire2` int(11) NOT NULL,
  `tv_umpire` int(11) NOT NULL,
  `match_ref` int(11) NOT NULL,
  `res_umpire` int(11) NOT NULL,
  `match_result` varchar(100) NOT NULL DEFAULT '',
  `local_time` time NOT NULL,
  `match_cat` int(2) NOT NULL,
  `mom_id` int(10) NOT NULL DEFAULT '0',
  `winning_team_id` int(10) NOT NULL DEFAULT '0',
  `match_day_night` int(11) NOT NULL DEFAULT '0',
  `venue_id` int(10) NOT NULL,
  `scorer` varchar(150) NOT NULL,
  `points` int(10) NOT NULL DEFAULT '1',
  `is_points` int(11) NOT NULL DEFAULT '1',
  `match_result_status` int(11) NOT NULL DEFAULT '0',
  `match_no` varchar(50) NOT NULL,
  PRIMARY KEY (`match_id`)
) ENGINE=InnoDB AUTO_INCREMENT=218 DEFAULT CHARSET=latin1;



DROP TABLE IF EXISTS country;

CREATE TABLE `country` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `iso` char(2) NOT NULL,
  `name` varchar(80) NOT NULL,
  `nicename` varchar(80) NOT NULL,
  `iso3` char(3) DEFAULT NULL,
  `numcode` smallint(6) DEFAULT NULL,
  `phonecode` int(5) NOT NULL,
  `flagPath` varchar(30) NOT NULL,
  `status` int(11) NOT NULL DEFAULT '1',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=240 DEFAULT CHARSET=latin1;



DROP TABLE IF EXISTS match_has_player;

CREATE TABLE `match_has_player` (
  `mhp_id` int(11) NOT NULL AUTO_INCREMENT,
  `match_id` int(10) NOT NULL,
  `player_id` int(10) NOT NULL,
  `team_id` int(10) NOT NULL,
  `bat_seq` int(10) NOT NULL,
  `bowl_seq` int(10) NOT NULL,
  `inngs` int(10) NOT NULL,
  `score` int(4) NOT NULL,
  `balls` int(4) NOT NULL,
  `out_str` varchar(100) NOT NULL,
  `fours` int(4) NOT NULL,
  `sixes` int(4) NOT NULL,
  `overs` double NOT NULL,
  `madin` int(3) NOT NULL,
  `b_runs` int(4) NOT NULL,
  `wicks` int(2) NOT NULL,
  `wides` int(3) NOT NULL,
  `nobals` int(3) NOT NULL,
  `this_over_runs` int(3) NOT NULL,
  `b_sixes` int(3) NOT NULL,
  `b_fours` int(3) NOT NULL,
  `candb` int(3) NOT NULL,
  `f_catches` int(3) NOT NULL,
  `f_IR` int(3) NOT NULL,
  `w_keeper` int(3) NOT NULL,
  `f_DR` int(3) NOT NULL,
  `keeper_stumps` int(3) NOT NULL,
  `captain` int(3) NOT NULL,
  `in_final` int(11) NOT NULL DEFAULT '0',
  PRIMARY KEY (`mhp_id`)
) ENGINE=InnoDB AUTO_INCREMENT=1526 DEFAULT CHARSET=latin1;



DROP TABLE IF EXISTS match_has_team;

CREATE TABLE `match_has_team` (
  `mht_id` int(11) NOT NULL AUTO_INCREMENT,
  `match_id` int(10) NOT NULL,
  `team_id` int(10) NOT NULL,
  `bat_seq` int(10) NOT NULL,
  `inngs` int(10) NOT NULL DEFAULT '1',
  `score` int(5) NOT NULL,
  `wickets` int(2) NOT NULL,
  `result` varchar(250) NOT NULL,
  `overs` double NOT NULL,
  `bys` int(3) NOT NULL,
  `leg_bys` int(3) NOT NULL,
  `wide` int(3) NOT NULL,
  `noballs` int(3) NOT NULL,
  `fall_of_wicket` text NOT NULL,
  `maxOvers` int(11) NOT NULL DEFAULT '25',
  `fours` int(11) NOT NULL,
  `sixes` int(11) NOT NULL,
  PRIMARY KEY (`mht_id`)
) ENGINE=InnoDB AUTO_INCREMENT=403 DEFAULT CHARSET=latin1;



DROP TABLE IF EXISTS match_type;

CREATE TABLE `match_type` (
  `match_type_id` int(10) NOT NULL AUTO_INCREMENT,
  `match_type_title` varchar(45) NOT NULL,
  PRIMARY KEY (`match_type_id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=latin1;



DROP TABLE IF EXISTS matchschedule;

CREATE TABLE `matchschedule` (
  `schedule_id` int(10) NOT NULL AUTO_INCREMENT,
  `match_id` int(10) NOT NULL,
  `start_date` datetime NOT NULL,
  `local_time` time NOT NULL,
  `description` varchar(200) NOT NULL,
  PRIMARY KEY (`schedule_id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;



DROP TABLE IF EXISTS pictures;

CREATE TABLE `pictures` (
  `picture_id` int(10) NOT NULL AUTO_INCREMENT,
  `picture_title` varchar(100) NOT NULL,
  `picture_description` text NOT NULL,
  `picture_type` varchar(100) NOT NULL,
  `picture_type_id` int(11) NOT NULL,
  `createdOn` datetime NOT NULL,
  `updatedOn` datetime NOT NULL,
  `pic_path` varchar(200) NOT NULL,
  PRIMARY KEY (`picture_id`)
) ENGINE=InnoDB AUTO_INCREMENT=83 DEFAULT CHARSET=latin1;



DROP TABLE IF EXISTS player;

CREATE TABLE `player` (
  `player_id` int(10) NOT NULL AUTO_INCREMENT,
  `bowl_style_id` int(10) NOT NULL,
  `bat_style_id` int(10) NOT NULL,
  `player_name` varchar(255) NOT NULL,
  `player_logo` varchar(255) NOT NULL,
  `player_status` int(10) NOT NULL DEFAULT '2',
  `player_search_name` varchar(100) NOT NULL,
  `player_country_id` int(10) NOT NULL,
  `player_cat` int(2) NOT NULL,
  `playing_role` int(10) NOT NULL,
  `description` text NOT NULL,
  `dob` varchar(100) NOT NULL,
  `phonenumber` varchar(100) NOT NULL,
  PRIMARY KEY (`player_id`)
) ENGINE=InnoDB AUTO_INCREMENT=400 DEFAULT CHARSET=latin1;



DROP TABLE IF EXISTS player_role;

CREATE TABLE `player_role` (
  `player_role_id` int(11) NOT NULL AUTO_INCREMENT,
  `player_role_title` varchar(150) NOT NULL,
  PRIMARY KEY (`player_role_id`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=latin1;



DROP TABLE IF EXISTS points_confiure;

CREATE TABLE `points_confiure` (
  `pc_id` int(11) NOT NULL AUTO_INCREMENT,
  `pc_name` varchar(150) NOT NULL,
  `tournament_id` int(11) NOT NULL,
  `cDate` datetime NOT NULL,
  `uDate` datetime NOT NULL,
  `points` int(11) NOT NULL,
  PRIMARY KEY (`pc_id`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=latin1;



DROP TABLE IF EXISTS team;

CREATE TABLE `team` (
  `team_id` int(10) NOT NULL AUTO_INCREMENT,
  `team_name` varchar(100) NOT NULL,
  `team_logo` varchar(255) NOT NULL,
  `team_small_name` varchar(20) NOT NULL,
  `team_cat` int(10) NOT NULL,
  `description` text NOT NULL,
  `status` int(11) NOT NULL DEFAULT '2',
  PRIMARY KEY (`team_id`)
) ENGINE=InnoDB AUTO_INCREMENT=18 DEFAULT CHARSET=latin1;



DROP TABLE IF EXISTS team_has_player;

CREATE TABLE `team_has_player` (
  `thp_id` int(10) NOT NULL AUTO_INCREMENT,
  `team_id` int(10) NOT NULL,
  `player_id` int(10) NOT NULL,
  PRIMARY KEY (`thp_id`)
) ENGINE=InnoDB AUTO_INCREMENT=478 DEFAULT CHARSET=latin1;



DROP TABLE IF EXISTS tournament;

CREATE TABLE `tournament` (
  `tournament_id` int(10) NOT NULL AUTO_INCREMENT,
  `tournament_name` varchar(100) NOT NULL,
  `tournament_logo` varchar(255) NOT NULL,
  `start_date` date NOT NULL,
  `end_date` date NOT NULL,
  `points_table` int(2) NOT NULL DEFAULT '1',
  `tour_cat` varchar(50) NOT NULL,
  `short_name` varchar(20) NOT NULL,
  `year` varchar(100) NOT NULL,
  PRIMARY KEY (`tournament_id`)
) ENGINE=InnoDB AUTO_INCREMENT=12 DEFAULT CHARSET=latin1;



DROP TABLE IF EXISTS tournament_has_player;

CREATE TABLE `tournament_has_player` (
  `t_thp_id` int(10) NOT NULL AUTO_INCREMENT,
  `player_id` int(10) NOT NULL,
  `team_id` int(10) NOT NULL,
  `tournament_id` int(10) NOT NULL,
  `odi` int(10) NOT NULL DEFAULT '0',
  `test` int(10) NOT NULL DEFAULT '0',
  `t20` int(10) NOT NULL DEFAULT '0',
  PRIMARY KEY (`t_thp_id`)
) ENGINE=InnoDB AUTO_INCREMENT=631 DEFAULT CHARSET=latin1;



DROP TABLE IF EXISTS tournament_has_team;

CREATE TABLE `tournament_has_team` (
  `played` int(3) NOT NULL,
  `won` int(3) NOT NULL,
  `Lost` int(3) NOT NULL,
  `tied` int(3) NOT NULL,
  `nr` int(3) NOT NULL,
  `points` int(4) NOT NULL,
  `runrate` varchar(50) NOT NULL,
  `tht_id` int(10) NOT NULL AUTO_INCREMENT,
  `tournament_id` int(10) NOT NULL,
  `team_id` int(11) NOT NULL,
  PRIMARY KEY (`tht_id`)
) ENGINE=InnoDB AUTO_INCREMENT=37 DEFAULT CHARSET=latin1;



DROP TABLE IF EXISTS tournament_has_team_p;

CREATE TABLE `tournament_has_team_p` (
  `played` int(3) NOT NULL,
  `won` int(3) NOT NULL,
  `Lost` int(3) NOT NULL,
  `tied` int(3) NOT NULL,
  `nr` int(3) NOT NULL,
  `points` int(4) NOT NULL,
  `runrate` float NOT NULL,
  `tht_id` int(10) NOT NULL AUTO_INCREMENT,
  `tournament_id` int(10) NOT NULL,
  `team_id` int(11) NOT NULL,
  PRIMARY KEY (`tht_id`)
) ENGINE=InnoDB AUTO_INCREMENT=11 DEFAULT CHARSET=latin1;



DROP TABLE IF EXISTS umpire;

CREATE TABLE `umpire` (
  `umpire_id` int(10) NOT NULL AUTO_INCREMENT,
  `umpire_name` varchar(100) NOT NULL,
  `umpire_status` int(11) NOT NULL DEFAULT '1',
  `umpire_country` int(10) NOT NULL,
  `umpire_dob` date NOT NULL,
  `umpire_logo` varchar(100) NOT NULL,
  PRIMARY KEY (`umpire_id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;



DROP TABLE IF EXISTS users;

CREATE TABLE `users` (
  `uId` int(11) NOT NULL AUTO_INCREMENT,
  `username` varchar(150) NOT NULL,
  `emailId` varchar(150) NOT NULL,
  `password` varchar(150) NOT NULL,
  `role_name` varchar(150) NOT NULL,
  `udId` varchar(300) NOT NULL,
  `cDate` datetime NOT NULL,
  `uDate` datetime NOT NULL,
  `deviceType` varchar(150) NOT NULL,
  `team_id` int(11) NOT NULL,
  `ustatus` int(11) NOT NULL DEFAULT '2',
  PRIMARY KEY (`uId`)
) ENGINE=InnoDB AUTO_INCREMENT=15 DEFAULT CHARSET=latin1;



DROP TABLE IF EXISTS venue;

CREATE TABLE `venue` (
  `venue_id` int(10) NOT NULL AUTO_INCREMENT,
  `venue_title` varchar(150) NOT NULL,
  `venue_description` text NOT NULL,
  `venue_location` varchar(100) NOT NULL,
  `country_id` int(10) NOT NULL,
  `geoLat` float NOT NULL,
  `geoLang` float NOT NULL,
  PRIMARY KEY (`venue_id`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=latin1;



DROP TABLE IF EXISTS videos;

CREATE TABLE `videos` (
  `video_id` int(10) NOT NULL AUTO_INCREMENT,
  `video_title` varchar(100) NOT NULL,
  `video_description` text NOT NULL,
  `video_type` varchar(100) NOT NULL,
  `video_type_id` int(11) NOT NULL,
  `createdOn` datetime NOT NULL,
  `updatedOn` datetime NOT NULL,
  `video_path` varchar(200) NOT NULL,
  `thumbnail` varchar(300) NOT NULL,
  `duration` varchar(100) NOT NULL DEFAULT '00:00:00',
  PRIMARY KEY (`video_id`)
) ENGINE=InnoDB AUTO_INCREMENT=51 DEFAULT CHARSET=latin1;



